            width: 100%;
        }
        table.data-table tr {
            border-bottom: 1px solid rgb(222, 226, 230);
        }
        table.data-table th,
        table.data-table td {
            background-color: rgb(255, 255, 255);
            padding: 12px;
            text-align: left;
            vertical-align: top;
        }
        table.data-table td.blank {
            background-color: rgb(243, 243, 243);
        }
        table.data-table td ol,
        table.data-table td ul {
            margin: 0 0 0 17px;
            padding: 0;
        }
        text {
          font-weight: 300;
          font-family: "Helvetica Neue", Helvetica, Arial, sans-serf;
          font-size: 14px;
        }
        .node rect {
          stroke: #637DAA;
          fill: #fff;
          stroke-width: 1.5px;
        }
        .edgePath path {
          stroke: #9FB7E1;
          stroke-width: 1.5px;
        }
        .new-page {
            page-break-before: always;
        }
